import React from "react";
import FoodCard from "./FoodCard";
import FoodMenu from "./FoodMenu";
import Discount from './Discount';


const MenuWrapper = () => {
  return (
    <div className  style={{ backgroundColor: "#E5E5E5" }}>
      <FoodMenu />
      <FoodCard />
      <Discount/>
    </div>
  );
};
export default MenuWrapper;
